a:260:{i:0;a:1:{s:2:"id";s:19:"2391166366172212330";}i:1;a:1:{s:10:"short_code";s:11:"CEvISQejmxq";}i:2;a:1:{s:12:"created_time";i:1599269265;}i:3;a:1:{s:7:"caption";s:1928:"🔥🔥 A SCP ou Sociedade em Conta de Participação é uma Sociedade criada entre duas ou mais pessoas para a realização de uma atividade comercial pré-determinada. A mesma é constituída por um Sócio Ostensivo (gestor e executor do projeto) e por demais Sócios Participantes (investidores). 

O Sócio Ostensivo deve ser necessariamente uma pessoa jurídica que realiza em seu nome e sob sua própria e exclusiva responsabilidade, a atividade constitutiva do objeto social da SCP. Em outras palavras, é ele o sócio responsável por administrar o recurso e entregar o resultado para os Sócios Investidores. 

Os Sócios Participantes por sua vez, participam da sociedade apenas aportando o capital, essa é a sua única e exclusiva responsabilidade no negócio; eles não respondem solidariamente por nenhuma outra obrigação do projeto. 

A SCP é um modelo comumente utilizado por empresas e grandes operações para viabilizar e oportunizar negócios altamente rentáveis entre as partes interessadas.

É muito utilizada em vários setores, tais como: Incorporação Imobiliária, Shopping´s, Agronegócio, Energia, Aviação, Tecnologia, etc...

